Here's a Java solution to the problem:

```
class Solution {
    public boolean isPowerOfThree(int n) {
        if (n <= 0) {
            return false;
        }
        int x = 1;
        while (n % x == 0) {
            x++;
        }
        return n == 3 * x;
    }
}
```

The solution uses a while loop to iterate until we find an x such that n % x == 0. We use the modulo operator (%) to check if n is divisible by x. If it is, we update the value of x and continue the loop. If we iterate long enough, we'll eventually find an x such that n % x == 0.

Once we have an x, we check if n == 3 * x. If it is, we return true; otherwise, we return false.

